import {reqCategoryList} from "@/api"

const state = {
  categoryList:[],
};

const mutations = {
  CATEGORYLIST(state,categoryList){
    state.categoryList = categoryList;
  }
};

const getters = {};
const actions = {
  async categoryList(commit){
    let result = await reqCategoryList;
    if(result.code === 200){
      commit("CATEGORYLIST",result.data);
    }
  }
};

export default {
  state,
  mutations,
  getters,
  actions
}
